//spreadsheets.google.com/feeds/cells/1yCfgbraMZmfgFCcysqD0-iTdjXdgSM6aBM0FhboV9oU/1/public/full/R190C8"},"updated":{"$t":"2019-10-05T10:27:21.550Z"},"category":[{"scheme":"http://schemas.google.com/spreadsheets/2006","term":"http://schemas.google.com/spreadsheets/2006#cell"}],"title":{"type":"text","$t":"H190"},"content":{"type":"text","$t":"Noheul Lee, Loris Olivier"},"link":[{"rel":"self","type":"application/atom+xml","href":"https://spreadsheets.google.com/feeds/cells/1yCfgbraMZmfgFCcysqD0-iTdjXdgSM6aBM0FhboV9oU/1/public/full/R190C8"}],"gs$cell":{"row":"190","col":"8","inputValue":"Noheul Lee, Loris Olivier","$t":"Noheul Lee, Loris Olivier"}},{"id":{"$t":"https://spreadsheets.google.com/feeds/cells/1yCfgbraMZmfgFCcysqD0-iTdjXdgSM6aBM0FhboV9oU/1/public/full/R190C9"},"updated":{"$t":"2019-10-05T10:27:21.550Z"},"category":[{"scheme":"http://schemas.google.com/spreadsheets/2006","term":"http://schemas.google.com/spreadsheets/2006#cell"}],"title":{"type":"text","$t":"I190"},"content":{"type":"text","$t":"Typeface and graphic designer Noheul Lee has received her M.A. Visual Communication Design from Kookmin University, Seoul, Korea and graduated the MA TypeMedia at the Royal Academy of Arts (KABK), the Hague, Netherlands. She has been working as a typeface designer fucusing on Hangeul and Latin alphabets. Noheul was selected for the 6th Bang Ilyoung Cultural Foundation Grant for Font Creation, Korea, and the recipient of a gold medal for Latin category, Morisawa Type Competition in 2019. She is planning to open ‘lo-ol foundry’, an independent studio centered on fonts and graphic design. Lee has been working on ‘Areon’, and ‘Arvana’ which is scheduled for release at furturefont.xyz in October 2019. \nLoris Olivier is a designer based in Lausanne, Switzerland. He studied Graphic Design at Academy of Art University and received his MA TypeMedia at the Royal Academy of Arts, Hague, Netherlands. Olivier works across the various field such as visual, interactive, branding strategy and font design. He is a branding strategist at Superhuit, a digital agency in Laussane, Switzerland. He is planning to launch ‘lo-ol foundry’, an independent studio centered on typeface and graphic design, in 2020. "},"link":[{"rel":"self","type":"application/atom+xml","href":"https://spreadsheets.google.com/feeds/cells/1yCfgbraMZmfgFCcysqD0-iTdjXdgSM6aBM0FhboV9oU/1/public/full/R190C9"}],"gs$cell":{"row":"190","col":"9","inputValue":"Typeface and graphic designer Noheul Lee has received her M.A. Visual Communication Design from Kookmin University, Seoul, Korea and graduated the MA TypeMedia at the Royal Academy of Arts (KABK), the Hague, Netherlands. She has been working as a typeface designer fucusing on Hangeul and Latin alphabets. Noheul was selected for the 6th Bang Ilyoung Cultural Foundation Grant for Font Creation, Korea, and the recipient of a gold medal for Latin category, Morisawa Type Competition in 2019. She is planning to open ‘lo-ol foundry’, an independent studio centered on fonts and graphic design. Lee has been working on ‘Areon’, and ‘Arvana’ which is scheduled for release at furturefont.xyz in October 2019. \nLoris Olivier is a designer based in Lausanne, Switzerland. He studied Graphic Design at Academy of Art University and received his MA TypeMedia at the Royal Academy of Arts, Hague, Netherlands. Olivier works across the various field such as visual, interactive, branding strategy and font design. He is a branding strategist at Superhuit, a digital agency in Laussane, Switzerland. He is planning to launch ‘lo-ol foundry’, an independent studio centered on typeface and graphic design, in 2020. ","$t":"Typeface and graphic designer Noheul Lee has received her M.A. Visual Communication Design from Kookmin University, Seoul, Korea and graduated the MA TypeMedia at the Royal Academy of Arts (KABK), the Hague, Netherlands. She has been working as a typeface designer fucusing on Hangeul and Latin alphabets. Noheul was selected for the 6th Bang Ilyoung Cultural Foundation Grant for Font Creation, Korea, and the recipient of a gold medal for Latin category, Morisawa Type Competition in 2019. She is planning to open ‘lo-ol foundry’, an independent studio centered on fonts and graphic design. Lee has been working on ‘Areon’, and ‘Arvana’ which is scheduled for release at furturefont.xyz in October 2019. \nLoris Olivier is a designer based in Lausanne, Switzerland. He studied Graphic Design at Academy of Art University and received his MA TypeMedia at the Royal Academy of Arts, Hague, Netherlands. Olivier works across the various field such as visual, interactive, branding strategy and font design. He is a branding strategist at Superhuit, a digital agency in Laussane, Switzerland. He is planning to launch ‘lo-ol foundry’, an independent studio centered on typeface and graphic design, in 2020. "}},{"id":{"$t":"https://spreadsheets.google.com/feeds/cells/1yCfgbraMZmfgFCcysqD0-iTdjXdgSM6aBM0FhboV9oU/1/public/full/R190C10"},"updated":{"$t":"2019-10-05T10:27:21.550Z"},"category":[{"scheme":"http://schemas.google.com/spreadsheets/2006","term":"http://schemas.google.com/spreadsheets/2006#cell"}],"title":{"type":"text","$t":"J190"},"content":{"type":"text","$t":"Arvana Regular\nRoots"},"link":[{"rel":"self","type":"application/atom+xml","href":"https://spreadsheets.google.com/feeds/cells/1yCfgbraMZmfgFCcysqD0-iTdjXdgSM6aBM0FhboV9oU/1/public/full/R190C10"}],"gs$cell":{"row":"190","col":"10","inputValue":"Arvana Regular\nRoots","$t":"Arvana Regular\nRoots"}},{"id":{"$t":"https://spreadsheets.google.com/feeds/cells/1yCfgbraMZmfgFCcysqD0-iTdjXdgSM6aBM0FhboV9oU/1/public/full/R190C11"},"updated":{"$t":"2019-10-05T10:27:21.550Z"},"category":[{"scheme":"http://schemas.google.com/spreadsheets/2006","term":"http://schemas.google.com/spreadsheets/2006#cell"}],"title":{"type":"text","$t":"K190"},"content":{"type":"text","$t":"‘Arvana Regular’(Type Forest) is a bi-script font in Humanist style that conveys the sharp but soft impression and the characteristics of flat pens and scalpel blades. ‘Arvana’ was first created from the imagination of what Korean serif font would look like if it was designed with Western writing tools rather than a brush. The font type tried to smoothly depict the sharp shape while maintaining the delicacy of strokes. A touch of the designer's handwriting was applied to some parts of the consonants and vowels. For example, the slight curves in the pedestal alphabets ‘ㄴ’ and ‘ㄹ’ emphasised the consonants of the designer's name while borrowing the split shape of calligraphy. Therefore, it differentiates the body and naturally reveals the identity of the designer. \n‘Root’(Variable Type Show) uses the three transformation axis, namely, ‘weight’, ‘straight’ and ‘seeds’, to express the function of root that supports anchorage of the plant. Roots can be thick or thin and curvy or stiff. The font depicts an image of a seed sprouting and spreading its root out."},"link":[{"rel":"self","type":"application/atom+xml","href":"https://spreadsheets.google.com/feeds/cells/1yCfgbraMZmfgFCcysqD0-iTdjXdgSM6aBM0FhboV9oU/1/public/full/R190C11"}],"gs$cell":{"row":"190","col":"11","inputValue":"‘Arvana Regular’(Type Forest) is a bi-script font in Humanist style that conveys the sharp but soft impression and the characteristics of flat pens and scalpel blades. ‘Arvana’ was first created from the imagination of what Korean serif font would look like if it was designed with Western writing tools rather than a brush. The font type tried to smoothly depict the sharp shape while maintaining the delicacy of strokes. A touch of the designer's handwriting was applied to some parts of the consonants and vowels. For example, the slight curves in the pedestal alphabets ‘ㄴ’ and ‘ㄹ’ emphasised the consonants of the designer's name while borrowing the split shape of calligraphy. Therefore, it differentiates the body and naturally reveals the identity of the designer. \n‘Root’(Variable Type Show) uses the three transformation axis, namely, ‘weight’, ‘straight’ and ‘seeds’, to express the function of root that supports anchorage of the plant. Roots can be thick or thin and curvy or stiff. The font depicts an image of a seed sprouting and spreading its root out.","$t":"‘Arvana Regular’(Type Forest) is a bi-script font in Humanist style that conveys the sharp but soft impression and the characteristics of flat pens and scalpel blades. ‘Arvana’ was first created from the imagination of what Korean serif font would look like if it was designed with Western writing tools rather than a brush. The font type tried to smoothly depict the sharp shape while maintaining the delicacy of strokes. A touch of the designer's handwriting was applied to some parts of the consonants and vowels. For example, the slight curves in the pedestal alphabets ‘ㄴ’ and ‘ㄹ’ emphasised the consonants of the designer's name while borrowing the split shape of calligraphy. Therefore, it differentiates the body and naturally reveals the identity of the designer. \n‘Root’(Variable Type Show) uses the three transformation axis, namely, ‘weight’, ‘straight’ and ‘seeds’, to express the function of root that supports anchorage of the plant. Roots can be thick or thin and curvy or stiff. The font depicts an image of a seed sprouting and spreading its root out."}},{"id":{"$t":"https://spreadsheets.google.com/feeds/cells/1yCfgbraMZmfgFCcysqD0-iTdjXdgSM6aBM0FhboV9oU/1/public/full/R190C12"},"updated":{"$t":"2019-10-05T10:27:21.550Z"},"category":[{"scheme":"http://schemas.google.com/spreadsheets/2006","term":"http://schemas.google.com/spreadsheets/2006#cell"}],"title":{"type":"text","$t":"L190"},"content":{"type":"text","$t":"sheet, 1135× 250\ndigital film, 1280×800, 2019"},"link":[{"rel":"self","type":"application/atom+xml","href":"https://spreadsheets.google.com/feeds/cells/1yCfgbraMZmfgFCcysqD0-iTdjXdgSM6aBM0FhboV9oU/1/public/full/R190C12"}],"gs$cell":{"row":"190","col":"12","inputValue":"sheet, 1135× 250\n